import axios from 'axios';
class SDocServerApi {
  constructor(options) {
    if (!options.docUuid) {
      throw new Error('settings has no docUuid');
    }
    if (!options.sdocServer) {
      throw new Error('settings has no sdocServer');
    }
    if (!options.accessToken) {
      throw new Error('settings has no accessToken');
    }
    this.server = options.sdocServer;
    this.docUuid = options.docUuid;
    this.accessToken = options.accessToken;
  }
  getDocContent() {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/");
    return axios.get(url, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  normalizeSdocContent() {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/normalize-sdoc");
    return axios.get(url, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  saveDocContent(content) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/");
    const formData = new FormData();
    formData.append('doc_content', content);
    return axios.post(url, formData, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  getCollaborators() {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/collaborators/");
    return axios.get(url, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  listComments() {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/");
    return axios.get(url, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  insertComment(comment) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/");
    return axios.post(url, comment, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  deleteComment(commentId) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/").concat(commentId, "/");
    return axios.delete(url, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  updateComment(commentId, newComment) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/").concat(commentId, "/");
    return axios.put(url, newComment, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  updateCommentState(commentId, resolved) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/").concat(commentId, "/");
    const newComment = {};
    if (resolved) {
      newComment.resolved = 'true';
    } else {
      newComment.resolved = 'false';
    }
    return axios.put(url, newComment, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  insertReply(commentId, reply) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/").concat(commentId, "/replies/");
    return axios.post(url, reply, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  deleteReply(commentId, replyId) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/").concat(commentId, "/replies/").concat(replyId, "/");
    return axios.delete(url, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
  updateReply(commentId, replyId, reply) {
    const {
      server,
      docUuid,
      accessToken
    } = this;
    const url = "".concat(server, "/api/v1/docs/").concat(docUuid, "/comment/").concat(commentId, "/replies/").concat(replyId, "/");
    return axios.put(url, reply, {
      headers: {
        Authorization: "Token ".concat(accessToken)
      }
    });
  }
}
export default SDocServerApi;
